import { NgModule } from '@angular/core';
import { BrowserModule } from '@angular/platform-browser';
import { AppComponent } from './app.component';
import { ContactEditComponent } from './contact-edit/contact-edit.component'; // Adjust path as necessary
import { ContactAddComponent } from './contact-add/contact-add.component'; // Adjust path as necessary
import { ContactService } from './services/contact.service'; // Adjust path as needed

@NgModule({
  declarations: [
    AppComponent,
    ContactEditComponent,
    ContactAddComponent // Ensure ContactAddComponent is declared here
    // Other components, directives, pipes
  ],
  imports: [
    BrowserModule
    // Other modules you might need
  ],
  providers: [
    ContactService // Add ContactService to providers
  ],
  bootstrap: [AppComponent]
})
export class AppModule { }
